INSERT INTO scenario (id, content, last_edition) VALUES (2, 'Un jeune Romain ambitieux, Caius Saugrenus, suggère à César d''essayer de corrompre les Gaulois qui lui résistent (encore et toujours) puisqu''il est impossible de les vaincre militairement. Ayant reçu carte blanche, Saugrenus imagine d''acheter les menhirs qu''Obélix transporte sempiternellement sur son dos depuis le début de la série. Rapidement couvert de sesterces par le Romain, qui veut toujours plus de menhirs, Obélix est obligé d''embaucher des assistants, de payer des chasseurs etc. et devient le moteur économique du village. Les autres gaulois, jaloux du succès d''Obélix, décident (par suggestion d''Astérix) de tailler des menhirs eux aussi et au bout d''un certain temps, la moitié du village fait des menhirs et l''autre moitié la nourrit. Cependant, César s''alarmant des dépenses de Saugrenus mettant à mal l''économie de l''Empire romain, celui-ci entreprend de revendre les menhirs au public romain grâce à une campagne de publicité extraordinaire. De fil en aiguille, une gigantesque crise économique et sociale secoue l''Empire romain tout entier...', '2013-07-16 17:27:56');
INSERT INTO scenario (id, content, last_edition) VALUES (3, 'Un jeune Romain ambitieux, Caius Saugrenus, suggère à César d''essayer de corrompre les Gaulois qui lui résistent (encore et toujours) puisqu''il est impossible de les vaincre militairement. Ayant reçu carte blanche, Saugrenus imagine d''acheter les menhirs qu''Obélix transporte sempiternellement sur son dos depuis le début de la série. Rapidement couvert de sesterces par le Romain, qui veut toujours plus de menhirs, Obélix est obligé d''embaucher des assistants, de payer des chasseurs etc. et devient le moteur économique du village. Les autres gaulois, jaloux du succès d''Obélix, décident (par suggestion d''Astérix) de tailler des menhirs eux aussi et au bout d''un certain temps, la moitié du village fait des menhirs et l''autre moitié la nourrit. Cependant, César s''alarmant des dépenses de Saugrenus mettant à mal l''économie de l''Empire romain, celui-ci entreprend de revendre les menhirs au public romain grâce à une campagne de publicité extraordinaire. De fil en aiguille, une gigantesque crise économique et sociale secoue l''Empire romain tout entier...', '2013-07-16 17:05:18');
INSERT INTO scenario (id, content, last_edition) VALUES (5, '<p>Trois &eacute;l&egrave;ves nomm&eacute;s Arthur Bosquette, Victor Carmouze et Mickael Martinez ont une qu&ecirc;te commune : cr&eacute;er le meilleur PLIC possible avec un &eacute;diteur de bandes dessin&eacute;es collaboratif.</p>
<p>&nbsp;</p>
<p>Malheureusement, un sortil&egrave;ge leur a &eacute;t&eacute; jet&eacute; et ils n''ont pas pu finir leurs deux premi&egrave;res soutenances &agrave; temps.</p>
<p>&nbsp;</p>
<p>Tout est bien qui finit bien, car le PLIC danstabulle est une reussite.</p>', '2013-12-04 16:34:49');
