INSERT INTO bandedessinee (id, category_id, creator_id, palette_id, scenario_id, title, needdrawers, needscenarists, description) VALUES (3, 1, 1, NULL, 4, 'La Fureur du Foot', NULL, NULL, 'S''il n''a pas forcément le physique pour faire du sport, Steph en a toujours la passion. Que ce soit devant le petit écran chez lui avec sa "minoune" ou au café avec les copains ou encore dans les tribunes, ce petit bonhomme bien en chair est un furieux supporter du ballon rond. Plus de quarante scénettes lui sont consacrées apportant la confirmation de cette fureur du sport.');
INSERT INTO bandedessinee (id, category_id, creator_id, palette_id, scenario_id, title, needdrawers, needscenarists, description) VALUES (4, 5, 1, NULL, NULL, 'Asterix aux jeux olympiques', NULL, NULL, 'Astérix et Obélix se rendent en Grèce, à Olympie, pour participer aux Jeux olympiques. Une bonne partie du village gaulois les accompagne pour les soutenir. Malheureusement, quand ils arrivent, ils entendent parler de l''interdiction des produits dopants. La potion magique est considérée comme un produit interdit. Astérix n''a d''autre choix que de représenter la Gaule, seul, et sans potion magique.');
INSERT INTO bandedessinee (id, category_id, creator_id, palette_id, scenario_id, title, needdrawers, needscenarists, description) VALUES (6, 6, 1, NULL, NULL, 'Cédric, Parasite sur canapé', NULL, NULL, 'Gags en plusieurs planches, dans lesquels vous assisterez entre autre à une photo de classe, à l’enfermement bien involontaire de Cédric dans les toilettes de l‘école, à une soirée dansante improvisée, à une dispute sur le choix du programme télé ou encore à l’arrivée chez Cédric d’un nouveau fauteuil pour son grand-père.');
INSERT INTO bandedessinee (id, category_id, creator_id, palette_id, scenario_id, title, needdrawers, needscenarists, description) VALUES (7, 2, 1, NULL, NULL, 'L''élève Ducobu, la lutte des classes', NULL, NULL, 'C''est la lutte des classes, mais ce n''est heureusement pas la lutte finale pour autant. Monsieur Latouche, l''instit'', ne cesse de s''en prendre à Ducobu en lui posant des questions auxquelles il ne peut pas répondre. Quant à la première de classe, Léonie Gratin, elle continue de refuser à le laisser copier. Les pitreries de ce joyeux perturbateur de l''ordre établi pimentent d''humour et de poésie le quotidien de ses copains de classe.');
INSERT INTO bandedessinee (id, category_id, creator_id, palette_id, scenario_id, title, needdrawers, needscenarists, description) VALUES (8, 3, 1, NULL, NULL, 'La Grande Schtroumpfette', NULL, NULL, 'Une série de réflexions malheureuses et la Schtroumpfette réalise soudain que, si les Schtroumpfs l''adorent, ils ne la prennent pas du tout au sérieux. Pour lui donner l''occasion de s''affirmer, le Grand Schtroumpf annonce qu''il s''absente et qu''il l''a choisie comme remplaçante. Chez les Schtroumpfs, ce choix est négativement perçu. Un évènement inattendu va alors survenir.');
INSERT INTO bandedessinee (id, category_id, creator_id, palette_id, scenario_id, title, needdrawers, needscenarists, description) VALUES (1, 1, 1, NULL, 2, 'Obelix et compagnie', true, true, 'Un jeune Romain ambitieux, Caius Saugrenus, suggère à César d''essayer de corrompre les Gaulois qui lui résistent (encore et toujours) puisqu''il est impossible de les vaincre militairement. Ayant reçu carte blanche, Saugrenus imagine d''acheter les menhirs qu''Obélix transporte sempiternellement sur son dos depuis le début de la série. Rapidement couvert de sesterces par le Romain, qui veut toujours plus de menhirs, Obélix est obligé d''embaucher des assistants, de payer des chasseurs etc. et devient le moteur économique du village');
INSERT INTO bandedessinee (id, category_id, creator_id, palette_id, scenario_id, title, needdrawers, needscenarists, description) VALUES (2, 1, 1, NULL, 3, 'L''ordre des dragons', NULL, NULL, 'Depuis deux siècles, deux ordres mystérieux se livrent une guerre sans merci...
Eva une jeune femme, se retrouve malgré elle au coeur de la bataille!
À travers les pensées d’Eva et sa vie bousculée, le lecteur, adolescent ou adulte, entrevoit de sombres mystères sur fond d’idéologie nazie.
Un premier tome déroutant de sincérité, où les dessins soignés et ténébreux de Denis Rodier prennent toute leur valeur et remettent en cause l’Histoire telle qu’elle nous est enseignée.
Préparez-vous à lever le voile sur des secrets enfouis sous des décennies de
mensonges !');
INSERT INTO bandedessinee (id, category_id, creator_id, palette_id, scenario_id, title, needdrawers, needscenarists, description) VALUES (11, 7, 1, NULL, 5, 'DansTaBulle', true, true, 'Ceci est la bande dessinée du PLIC DansTaBulle.');
